import React from 'react';
import Slider from 'react-slick';

import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

function Carousel() {

  let settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  return (


    <Slider {...settings}>
    <div className='slider-container'>
      <h3>1</h3>
    </div>
    <div className='slider-container'>
      <h3>2</h3>
    </div>
    <div className='slider-container'>
      <h3>3</h3>
    </div>
    <div className='slider-container'>
      <h3>4</h3>
    </div>

  </Slider>



  )
}

export default Carousel;
